package com.az24.crawler.store;

import java.util.ArrayList;
import java.util.List;

import org.apache.http.NameValuePair;
import org.apache.http.message.BasicNameValuePair;

import com.az24.crawler.config.BeanXmlConfig;
import com.az24.crawler.model.ImageConfig;
import com.az24.crawler.model.Property;
import com.az24.dao.StoreDAO;

public class CrawlerProductTempPost {

	public static void main(String[] args) throws Exception {

		StoreDAO storeDAO = new StoreDAO();
		CrawlerProductTemp productExtract = new CrawlerProductTemp();

		String store_alias = args[0];
		String urlDomain = args[1];
		String urlDomainRewrite = args[2];
		String beanconfig = args[3];
		String catefile = args[4];

		// productExtract.getCategory("D:/categorys2/store_category_dongtrunghathaoHanQuoc_4302.xls");
		// BeanXmlConfig beanXmlConfig = new
		// BeanXmlConfig("D:/categorys2/beanProductStoreHieuitsme.xml");
		/*
		 * String store_alias = "dongtrunghathaoHanQuoc"; String urlDomain =
		 * "http://chodientu.vn/"; String urlDomainRewrite =
		 * "http://chodientu.vn/";
		 */

		BeanXmlConfig beanXmlConfig = new BeanXmlConfig(beanconfig);
		List<Category> listCate = productExtract.getCategory(catefile);
		productExtract.urlDomain = urlDomain;
		beanXmlConfig.parseConfig();
		List<Property> propeties = beanXmlConfig.bean.getProperties();
		List<ImageConfig> images = beanXmlConfig.bean.getImages();
		System.out.println(beanconfig);
		System.out.println(catefile);

		int store_id = 0;
		store_id = storeDAO.checkStore(store_alias);
		if (store_id == 0) {
			System.out.println("Khong Tim Thay Store");
			return;
		}

		// Process Category
		List<NameValuePair> list = null;
		for (Category category : listCate) {
			int i = 0;
			while (i <= 10) {
				list = new ArrayList<NameValuePair>();
				list.add(new BasicNameValuePair("Center1$ctl00$ddlSort", "1"));
				list.add(new BasicNameValuePair("Center1$ctl00$menuleft$Ti...",
						"Nhập từ khóa"));
				list.add(new BasicNameValuePair("ScriptManager1",
								"Center1$ctl00$updateProduct|Center1$ctl00$pagProduct$XrwPaging_Number_"+i));
				list.add(new BasicNameValuePair("__ASYNCPOST", "true"));
				list.add(new BasicNameValuePair("__SCROLLPOSITIONX", "0"));
				list.add(new BasicNameValuePair("__SCROLLPOSITIONY", "0"));
				list.add(new BasicNameValuePair("__EVENTARGUMENT", ""));
				list.add(new BasicNameValuePair("__EVENTTARGET","Center1$ctl00$pagProduct$XrwPaging_Number_"+i));
				list.add(new BasicNameValuePair("__LASTFOCUS", ""));
				list.add(new BasicNameValuePair("footer1$news$txtEmail","Email của bạn"));
				list.add(new BasicNameValuePair(
								"__VIEWSTATE",
								""));
				productExtract.processCategory(category, urlDomainRewrite,
						store_alias, store_id, propeties, images, list);
				i++;
			}
		}

	}

}
